import React from 'react';
import logo from '../../Icons/logo.png'

interface Props {
	id: string;
}

export const Img = ({ id }: Props) => {

	switch (id) {
		case 'leftBarLogo':
			return (

				<div>
					<img src={logo} alt="Reliz-logo" />
				</div>

			)


			default:
				return <img></img>;
	


			}
	}
